import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light justify-content">
      <a className="navbar-brand" href="/">
        Recipe Reading App
      </a>
    </nav>
  );
}

export default Nav;
